// const Youtuber = "Abhi";

// const car = "React Js";

// function myName() {
//   let name = "anna";
//   return name;
// }

// export default Youtuber;

// export { car, myName };

export const add = (a, b) => {
  return a + b;
};

export const sub = (a, b) => {
  return a - b;
};

function div(a, b) {
  return a / b;
}

function mul(a, b) {
  return a * b;
}

export { div, mul };
